import React, { useState, useEffect } from 'react';
import axios from 'axios';

const QuizPage = () => {
    const [questions, setQuestions] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchQuestions = async () => {
            try {
                const response = await axios.get('https://krish-2512.github.io/api/questions-2.json');
                setQuestions(response.data); // Assuming response.data is the array of questions
            } catch (err) {
                setError(err);
            } finally {
                setLoading(false);
            }
        };

        fetchQuestions();
    }, []);

    if (loading) return <div>Loading...</div>;
    if (error) return <div>Error loading questions: {error.message}</div>;

    return (
        <div>
            {questions.length === 0 ? (
                <div>No questions available.</div>
            ) : (
                questions.map((question, index) => (
                    <div key={index}>
                        <h3>{question.question}</h3>
                        <ul>
                            {question.options.map((option, i) => (
                                <li key={i}>{option}</li>
                            ))}
                        </ul>
                    </div>
                ))
            )}
        </div>
    );
};

export default QuizPage;
